(11, 8, 'The bank has to have the public keys of all customers in SET protocol as it has to ', '	check the digital signature of customers\n<br>', '	communicate with merchants\n<br>', '	communicate with merchants credit card company\n<br>', '	certify their keys\n<br>', 1),
(11, 9, 'In SET protocol a customer sends a purchase order ', '	encrypted with his public key<br>', '	in plain text form<br>', '	encrypted using Banks public key<br>', '	using digital Signature system<br>', 4),
(11, 10, 'Encryption can be done ', '	only on textual data\n<br>', '	only on ASCII coded data\n<br>', '	on any bit string\n<br>', '	only on mnemonic data\n<br>', 3),
(11, 11, 'Disadvantages of e-Commerce in India are (i) internet access is not universally available \n \n(ii) Credit card payment security is not yet guaranteed \n(iii) Transactions are de-personalized and human contact is missing \n(iv) Cyberlaws are not in place ', '	. i and ii\n<br>', '	ii and iii\n<br>', '	i, ii, iii\n<br>', '	. i, ii, iii, iv\n<br>', 3),
(11, 12, 'EDIFACT is a standard ', '	for representing business forms used in e-Commerce\n<br>', '	. for e-mail transaction for e-Commerce\n<br>', '	. for ftp in e-Commerce\n<br>', '	protocol used in e-Commerce\n<br>', 1),
(11, 13, 'For secure EDI transmission on internet ', '	MIME is used\n<br>', '	S/MIME is used\n<br>', '	PGP is used\n<br>', '	TCP/IP is used\n<br>', 2),
(11, 14, 'EDIFACT standard was developed by ', '	American National Standard Institute\n<br>', '	. International Standard Institute\n<br>', '	European Common Market\n<br>', '	United Nations Economic Commission for Europe\n<br>', 4),
(11, 15, 'Main function of proxy application gateway firewall is ', '	. to allow corporate users to use efficiently all internet services\n<br>', '	to allow intranet users to securely use specified internet services\n<br>', '	to allow corporate users to use all internet services\n<br>', '	to prevent corporate users from using internet services\n<br>', 2),
(11, 16, 'Public key encryption method is a system ', '	which uses a set of public keys one for each participant in e-Commerce\n<br>', '	in which each person who wants to communicate has two keys; a private key known to him only and a public key which is publicized to enable others to send message to him\n<br>', '	which uses the RSA coding system\n<br>', '	which is a standard for use in e-Commerce.\n<br>', 2),
(11, 17, 'One of the problems with using SET protocol is ', '	the merchants risk is high as he accepts encrypted credit card<br>', '	the credit card company should check digital signature<br>', '	the bank has to keep a database of the public keys of all customers<br>', '	. the bank has to keep a database of digital signatures of all customers<br>', 3),
(11, 18, 'A firewall is a ', '	wall built to prevent fires from damaging a corporate intranet# \n<br>', '	security device deployed at the boundary of a company to prevent unauthorized physical access# \n<br>', '	security device deployed at the boundary of a corporate intranet to protect it from unauthorized access# \n<br>', '	device to prevent all accesses from the internet to the corporate intranet# \n<br>', 3),
(11, 19, 'In cheque payment protocol, the purchase order form is signed by purchaser using ', '	his public key# \n<br>', '	his private key# \n<br>', '	his private key using his signature hardware# \n<br>', '	his private key using his signature hardware# \n<br>', 3),
(11, 20, 'In electronic cheque payments developed, it is assumed that most of the transactions will be ', '	customers to customers# \n<br>', '	customers to business# \n<br>', '	business to business# \n<br>', '	business to business# \n<br>', 3),
(11, 21, 'EDIFACT is a standard ', '	for representing business forms used in e-Commerce# \n<br>', '	for representing business forms used in e-Commerce# \n<br>', '	for ftp in e-Commerce# \n<br>', '	protocol used in e-Commerce# \n<br>', 1),
(11, 22, 'Hashed message is signed by a sender using ', '	his public key# \n<br>', '	his private key# \n<br>', '	receivers public key# \n<br>', '	receivers private key# \n<br>', 2),
(11, 23, 'Certification of Digital signature by an independent authority is needed because ', '	it is safe# \n<br>', '	. it gives confidence to a business# \n<br>', '	the authority checks and assures customers that the public key indeed belongs to the business which claims its ownership# \n<br>', '	the authority checks and assures customers that the public key indeed belongs to the business which claims its ownership# \n<br>', 3),
(11, 24, 'Message can be sent more securely using DES by ', '	Message can be sent more securely using DES by# \n<br>', '	encrypting plain text by a different random key for each message transmission and sending the key to the receiver using a public key system# \n<br>', '	using an algorithm to implement DES instead of using hardware# \n<br>', '	designing DES with high security and not publicizing algorithm used by it# \n<br>', 2),
(11, 25, 'While sending a signed message, a sender ', '	sends message key using public key encryption using DES and hashed message using public key encryption# \n<br>', '	sends message using public key encryption and hashed message using DES# \n<br>', '	sends message using public key encryption and hashed message using DES# \n<br>', '	sends message using public key encryption and hashed message using DES# \n<br>', 1),
(11, 26, 'Advantages of B2C commerce are (i) Business gets a wide reach to customers \n \n(ii) Payment for services easy \n(iii)Shop can be open 24 hours a day seven days a week \n(iv)Privacy of transaction always maintained ', '	i and ii\n<br>', '	ii and iii\n<br>', '	i and iii\n<br>', '	iii and iv\n<br>', 3),
(11, 27, 'B2C commerce ', '	includes services such as legal advice\n<br>', '	means only shopping for physical goods\n<br>', '	means only customers should approach customers to sell\n<br>', '	means only customers should approach business to buy\n<br>', 1),
(11, 28, 'EDI requires ', '	representation of common business documents in computer readable forms\n<br>', '	data entry operators by receivers\n<br>', '	special value added networks\n<br>', '	special hardware at co-operating Business premises\n<br>', 1),
(16, 4, 'I. India has surpassed the value of tea exports this year over all the earlier years due to an increase in demand for quality tea in the European market.\r\n<br>\r\nII. There is an increase in demand of coffee in the domestic market during the last two years.', 'Statement I is the cause and statement II is its effect', 'Statement II is the cause and statement I is its effect', 'Both the statements I and II are independent causes', 'Both the statements I and II are effects of independent causes', 3),
(8, 3, 'Applying for Seasonal Employment occurs when a person requests to be considered for a job that is dependent on a particular season or time of year. Which situation below is the best example of Applying for Seasonal Employment?', 'The ski instructors at Top of the Peak Ski School work from December through March.', 'Matthew prefers jobs that allow him to work outdoors.', 'Lucinda makes an appointment with the beach resort restaurant manager to interview for the summer waitressing position that was advertised in the newspaper.', 'Doug''s ice cream shop stays open until 11 p.m. during the summer months.', 3),
(8, 4, 'Violating an Apartment Lease occurs when a tenant does something prohibited by the legally binding document that he or she has signed with a landlord. Which situation below is the best example of Violating an Apartment Lease?', 'Tim has decided to move to another city, so he calls his landlord to tell him that he is not interested in renewing his lease when it expires next month.', 'Valerie recently lost her job and, for the last three months, has neglected to pay her landlord the monthly rent they agreed upon in writing when she moved into her apartment eight months ago.', 'Mark writes a letter to his landlord that lists numerous complaints about the apartment he has agreed to rent for two years.', 'Leslie thinks that her landlord is neglecting the building in which she rents an apartment. She calls her attorney to ask for advice.', 2),
(8, 5, 'An Informal Gathering occurs when a group of people get together in a casual, relaxed manner. Which situation below is the best example of an Informal Gathering?', 'The book club meets on the first Thursday evening of every month.', 'After finding out about his promotion, Jeremy and a few coworkers decide to go out for a quick drink after work.', 'Mary sends out 25 invitations for the bridal shower she is giving for her sister.', 'Whenever she eats at the Mexican restaurant, Clara seems to run into Peter.', 2),
(9, 1, 'Sample grammar question 1 ', 'A', 'A', 'A', 'A', 1),
(9, 2, 'Sample grammar question 2 ', 'b', 'b', 'b', 'b', 2),
